import React from "react";
import ExpenseItems from "./ExpenseItems";
import "./Expenses.css";

function Expenses(props) {
  return (
    <div>
      {props.data.map((expense, index) => (
        <ExpenseItems
          key={index}
          title={expense.title}
          price={expense.amount}
          date={expense.date}
        />
      ))}
    </div>
  );
}

export default Expenses;
